import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import express from 'express';

const root = ReactDOM.createRoot(document.getElementById('root'));

const cors = require('cors');

const app = express();

app.use(cors());

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
